import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../styles/header.css';

const Header = () => {
  const navigate = useNavigate();
  const { user, logout } = useAuth();
  const [showDropdown, setShowDropdown] = useState(false);
  const [theme, setTheme] = useState('dark');

  useEffect(() => {
    const savedTheme = localStorage.getItem('theme') || 'dark';
    setTheme(savedTheme);
    document.body.className = savedTheme === 'light' ? 'light-theme' : '';
  }, []);

  const toggleTheme = () => {
    const newTheme = theme === 'dark' ? 'light' : 'dark';
    setTheme(newTheme);
    localStorage.setItem('theme', newTheme);
    document.body.className = newTheme === 'light' ? 'light-theme' : '';
  };

  const handleLogout = () => {
    logout();
    navigate('/signin');
  };

  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };

  return (
    <nav className="top-nav">
      <div className="nav-container">
        <div className="nav-left">
          <div className="brand-container">
            <i className="fas fa-star brand-icon"></i>
            <span className="brand-name">Daffy</span>
          </div>
        </div>
        
        <div className="nav-center">
          <div className="search-container">
            <i className="fas fa-search search-icon"></i>
            <input type="text" className="search-input" placeholder="Search Daffy..." />
          </div>
        </div>
        
        <div className="nav-right">
          <button className="nav-btn" onClick={toggleTheme} title="Toggle dark mode">
            <i className={`fas ${theme === 'dark' ? 'fa-moon' : 'fa-sun'}`}></i>
          </button>
          
          <button className="nav-btn" title="Notifications">
            <i className="fas fa-bell"></i>
          </button>
          
          {user && (
            <div className="user-menu">
              <img 
                src={`https://via.placeholder.com/32x32/FFD700/000000?text=${user.firstName?.charAt(0) || 'U'}`}
                alt="Profile" 
                className="user-avatar" 
                onClick={toggleDropdown}
              />
              
              <div className={`user-dropdown ${showDropdown ? 'show' : ''}`}>
                  <div className="user-info">
                    <span className="user-name">{user.firstName} {user.lastName}</span>
                    <span className="user-email">{user.email}</span>
                  </div>
                  <div className="dropdown-actions">
                    <Link to="/profile" className="dropdown-item">
                      <i className="fas fa-user"></i> Profile
                    </Link>
                    <Link to="/settings" className="dropdown-item">
                      <i className="fas fa-cog"></i> Settings
                    </Link>
                    <div className="dropdown-divider"></div>
                    <button onClick={handleLogout} className="dropdown-item logout-btn">
                      <i className="fas fa-sign-out-alt"></i> Logout
                    </button>
                  </div>
                </div>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Header;
